export class soap_faultcodeEnum extends types.xsd_enum // enum
{
    constructor(e){
        super();
        this.v = e || 0;
        this.DataEncodingUnknown= 0;
        this.MustUnderstand= 1;
        this.Receiver= 2;
        this.Sender= 3;
        this.VersionMismatch= 4;
    }

    parse(obj, elem, s){
        if (s === `${NS_PREFIX["http://www.w3.org/2003/05/soap-envelope"]}:DataEncodingUnknown`) { this.v = this.DataEncodingUnknown; return true; }
        if (s === `${NS_PREFIX["http://www.w3.org/2003/05/soap-envelope"]}:MustUnderstand`) { this.v = this.MustUnderstand; return true; }
        if (s === `${NS_PREFIX["http://www.w3.org/2003/05/soap-envelope"]}:Receiver`) { this.v = this.Receiver; return true; }
        if (s === `${NS_PREFIX["http://www.w3.org/2003/05/soap-envelope"]}:Sender`) { this.v = this.Sender; return true; }
        if (s === `${NS_PREFIX["http://www.w3.org/2003/05/soap-envelope"]}:VersionMismatch`) { this.v = this.VersionMismatch; return true; }
        return false;
    }

    to_string(){
        if (this.v === this.DataEncodingUnknown) { return "soap:DataEncodingUnknown"; }
        if (this.v === this.MustUnderstand) { return "soap:MustUnderstand"; }
        if (this.v === this.Receiver) { return "soap:Receiver"; }
        if (this.v === this.Sender) { return "soap:Sender"; }
        if (this.v === this.VersionMismatch) { return "soap:VersionMismatch"; }
        return "";
    }
}
